import React from "react";

function SkillsSection() {
  const skills = ["HTML", "CSS", "JavaScript", "React", "Tailwind CSS"];

  return (
    <section className="max-w-2xl mx-auto mt-12 text-center">
      <h2 className="text-2xl font-bold text-gray-800 mb-6">My Skills</h2>
      <div className="flex flex-wrap justify-center gap-3">
        {skills.map((skill) => (
          <span
            key={skill}
            className="bg-blue-100 text-blue-600 px-4 py-2 rounded-full text-sm font-medium"
          >
            {skill}
          </span>
        ))}
      </div>
    </section>
  );
}

export default SkillsSection;
